    main {
      position: relative;
      z-index: 1;
      padding: 30px;
      text-align: center;
    }
    header {
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 16px;
      flex-wrap: wrap;
    }
    header img {
      width: 80px;
      height: 80px;
    }
    h1 {
      font-size: 28px;
      color: #004d40;
      margin: 0;
    }
    h2 {
      margin-top: 4px;
      font-size: 18px;
      color: #00796b;
    }
    input {
      padding: 12px;
      font-size: 16px;
      width: 260px;
      border-radius: 6px;
      border: 1px solid #aaa;
      margin-top: 20px;
    }
    button {
      padding: 12px 20px;
      font-size: 16px;
      background-color: #00796b;
      color: white;
      border: none;
      border-radius: 6px;
      cursor: pointer;
      margin-left: 10px;
    }
    button:hover {
      background-color: #004d40;
    }
    .card {
      max-width: 420px;
      margin: 30px auto;
      padding: 20px;
      border-radius: 12px;
      box-shadow: 0 6px 12px rgba(0,0,0,0.15);
      background-color: white;
      text-align: left;
      animation: fadeIn 0.4s ease-in-out;
    }
    .success { color: green; font-weight: bold; }
    .fail { color: red; font-weight: bold; }
    .icon {
      font-size: 30px;
      vertical-align: middle;
      margin-right: 10px;
    }
    footer {
      text-align: center;
      padding: 20px;
      color: #555;
      font-size: 14px;
      margin-top: 40px;
    }
    @keyframes fadeIn {
      from { opacity: 0; transform: translateY(20px); }
      to { opacity: 1; transform: translateY(0); }
    }
  </style>
